import {Alert} from 'react-bootstrap'
import {useState} from "react";
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import {faExclamationCircle} from '@fortawesome/free-solid-svg-icons/faExclamationCircle';
import {faTimes} from '@fortawesome/free-solid-svg-icons/faTimes';

const NagdaAlert = (props) => {
    const [show, setShow] = useState(true);
    if (show) {
        return (
            <div className={`position-absolute alert alert-${props.variant}`} role="alert"
                 style={{width: props.width, height: props.height, bottom: 0, left: "20%"}}>
                <small>
                    <FontAwesomeIcon icon={faExclamationCircle} className="fa-2x"/>
                    من اجل تجربة مستخدم وامان افضل نحن نستخدم الكوكيز وهذا اعلان منا بذلك احتراما لخصوصيتكم
                </small>
            </div>
        )
    }
};


export default NagdaAlert;
